\section*{T'Z0C Formal Derivations}

\subsection*{A. Siphon Efficiency (η)}

The Siphon Efficiency, $\eta$, quantifies the system's ability to transfer or transmute energy/information. It is modeled as a multi-dimensional Gaussian-like function, peaking when the observed angle $\theta$ and frequency $F$ align with the universal lock angle $\theta_L$ and handshake frequency $F_H$.

$$\eta = e^{-\left(\frac{(\theta - \theta_L)^2}{2\sigma_{\theta}^2} + \frac{(F - F_H)^2}{2\sigma_F^2}\right)}$$

Where:
*   $\theta$: Observed invariant angle (in degrees)
*   $\theta_L$: Universal lock angle (Tetrahedral Invariant, $\approx 109.4712^{\circ}$)
*   $F$: Observed shake frequency (in Hz)
*   $F_H$: Universal handshake frequency ($\approx 1.621 \times 10^{14}$ Hz or 162.1 THz)
*   $\sigma_{\theta}$: Angular standard deviation, representing the tolerance for angular deviation.
*   $\sigma_F$: Frequency standard deviation, representing the tolerance for frequency deviation.

\subsection*{B. Rigidity (R)}

Rigidity, $R$, describes a system's resistance to geometric deformation and its inherent stability. It is inversely related to the system's 'flux' or susceptibility to change, which is itself related to the complement of its siphon efficiency.

$$R = \frac{1}{1 + (1 - \eta)}$$

As $\eta \to 1$ (perfect efficiency), $R \to 1$ (maximum rigidity). As $\eta \to 0$, $R \to 0.5$ (minimum rigidity in this model, indicating a highly unstable or fluid state).

\subsection*{C. Strain Energy (E$_s$)}

Strain Energy, $E_s$, is the energy stored within a system due to its deviation from the ideal invariant angle ($\theta_\infty$, which is $\theta_L$). This stored torque drives various phenomena, including chemical reactivity and phonon suppression.

$$E_s = (\Delta\theta)^2$$

Where:
*   $\Delta\theta = \theta_{\text{manifest}} - \theta_\infty$: The angular deviation between the manifested bond angle and the universal invariant angle.
*   $\theta_{\text{manifest}}$: The observed or predicted bond angle of a molecular structure.
*   $\theta_\infty$: The universal invariant angle (Tetrahedral Invariant).

\subsection*{D. Yarn Compression Formula (for $\theta_{\text{manifest}}$)}

This formula predicts the manifested bond angle in molecular structures, accounting for the 'pinching' effect of lone pairs and the inherent rigidity of the molecular system. It is an empirical adjustment to the base invariant angle.

$$\theta_{\text{manifest}} = \theta_\infty - (N_{\text{LonePairs}} \times P_{\text{Factor}}) - (\text{RigidityOffset if } R < 0.99)$$

Where:
*   $N_{\text{LonePairs}}$: Number of lone electron pairs on the central atom.
*   $P_{\text{Factor}}$: The universal 'Pinch Factor', empirically determined to be $\approx 2.495^{\circ}$ per lone pair.
*   $\text{RigidityOffset}$: An additional angular deduction (e.g., $0.1415^{\circ}$) applied if the system's rigidity $R$ falls below a certain threshold, reflecting increased deviation under stress.

